import React, { Component } from "react";
import ExpenseName from "./expensename";
import ExpenseYouPaid from "./expenseyoupaid";
import ExpenseYouLent from "./expenseyoulent";

class ExpenseList extends Component {
  state = {
    current_expense_data: this.props.current_expense_data
  };
  render() {
    return (
      <React.Fragment>
        <div className="add_expense summary">
          <div className="main-block">
            <div className="date">
              Jan
              <div className="number">31</div>
            </div>
            <div className="header_name">
              <ExpenseName
                expenseName={
                  this.state.current_expense_data["expense_" + this.props.id]
                }
              />
            </div>
          </div>
          <div className="cost">
            you paid <br />{" "}
            <ExpenseYouPaid
              youPaid={
                this.state.current_expense_data["youPaid_" + this.props.id]
              }
            />
          </div>
          <div className="you">
            you lent <br />
            <ExpenseYouLent
              youLent={
                this.state.current_expense_data["youLent_" + this.props.id]
              }
            />
          </div>
          <div className="delete_actions">
            <a href="www.splitwise.com" className="delete">
              x
            </a>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default ExpenseList;
